/*
 *  Constructs a Splash as a child of 'parent', with the
 *  name 'name' and widget flags set to 'f'.
 */
Splash::Splash( QWidget* parent, const char* name, WFlags fl )
    : QWidget( parent, name, fl ),
      image0( (const char **) image0_data )
{
    if ( !name )
	setName( "Splash" );
    SplashLayout = new QGridLayout( this, 1, 1, 0, 0, "SplashLayout"); 

    pixmapLabel1 = new QLabel( this, "pixmapLabel1" );
    pixmapLabel1->setPixmap( image0 );
    pixmapLabel1->setScaledContents( TRUE );

    SplashLayout->addWidget( pixmapLabel1, 0, 0 );
    languageChange();
    resize( QSize(733, 518).expandedTo(minimumSizeHint()) );
    clearWState( WState_Polished );
    init();
}

/*
 *  Destroys the object and frees any allocated resources
 */
Splash::~Splash()
{
    // no need to delete child widgets, Qt does it all for us
}

/*
 *  Sets the strings of the subwidgets using the current
 *  language.
 */
void Splash::languageChange()
{
    setCaption( tr( "Virmac5X" ) );
}

